                    var sistemaSolar = [ <br>
                    ""Mercúrio"", ""Vênus"", ""Terra"", ""Marte"", ""Júpiter"", ""Saturno"", <br>
                    ""Urano"", ""Netuno""]; <br>
                    <br>
                    console.log(sistemaSolar.pop() + "" foi engolido!""); <br>
                    console.log(""Sobraram: "" + sistemaSolar); <br>
